import React from 'react';
import logo from './logo.svg';
import './App.css';

import LandingPage from './LandingPage.js'
import CreateAccount from './CreatAccount.js'



function App() {

  const createAccount = <CreateAccount />
  const landingPage = <LandingPage nav={setCurrentElement(createAccount).bind(this)} />
  var currentElement = landingPage

  function getCurrentElement() {
    return currentElement
  }
  function setCurrentElement(newElement) {
    currentElement = newElement
  }
  return (
    getCurrentElement()
  );
}

export default App;
